import React from 'react'
import './input.scss'


const Input = (props) => {
    return(
        <input onChange={(e)=> props.setformvalue(e.target.value)}
            name={props.name}
            value={props.value}
            type={props.type}
            placeholder={props.placeholder}
            className={props.className}
            requred
        />
    )
}
export default Input
